import React from 'react'
import {Text , StyleSheet , View , ScrollView , TextInput} from 'react-native'

const App = () => {
  return (
    <ScrollView style={Styles.interface}>
      <Text style={Styles.text}>
      Lorem ipsum dolor sit amet, consectetur adipiscing elit. Phasellus sollicitudin est felis,
       a pulvinar arcu rhoncus id. Quisque vitae tellus aliquam, fermentum libero eu, lobortis tortor.
        In nec nunc accumsan est ultricies mollis ac ut felis. In rutrum, magna a consectetur egestas,
         ex odio hendrerit metus, at fermentum erat enim in sem. In gravida egestas quam,
       in dapibus quam rutrum vitae. In hac habitasse platea dictumst. Nulla malesuada est mi, ut ultricies 
       tellus hendrerit sed. Pellentesque vehicula dapibus dui. Cras lacinia nulla at lectus porttitor, et malesuada dolor posuere.
      </Text>
    </ScrollView>
  )
}


const Styles = StyleSheet.create({
  container : {
    textAlign : 'center' ,
    fontSize  : '200px' ,
    color : 'red' ,
    opacity : '0.5'
  } ,

  text : {
    margin : '20px' ,
    fontSize : '40px'
  } ,

  interface : {
    width : "200px" ,
    height : "200px"
  }
})

export default App
